fn card_back_choice(id: CardBackId) -> &'static CardBackChoice {
    CARD_BACK_CHOICES
        .iter()
        .find(|c| c.id == id)
        .expect("card back choice")
}

fn card_back_choice_index(id: CardBackId) -> usize {
    CARD_BACK_CHOICES
        .iter()
        .position(|c| c.id == id)
        .expect("card back choice index")
}

const fn make_int_resource(id: u16) -> PCWSTR {
    PCWSTR(id as usize as *const u16)
}

pub fn run() -> Result<()> {
    unsafe {
        CoInitializeEx(None, COINIT_APARTMENTTHREADED | COINIT_DISABLE_OLE1DDE).ok()?;
    }

    let module = unsafe { GetModuleHandleW(None)? };
    let hinstance = HINSTANCE(module.0);
    let class_name = w!("MDHEARTS_WIN32");

    let h_icon = unsafe {
        LoadIconW(Some(hinstance), make_int_resource(IDI_APPICON))
            .unwrap_or_else(|_| LoadIconW(None, IDI_APPLICATION).unwrap_or_default())
    };
    let h_icon_small =
        unsafe { LoadIconW(Some(hinstance), make_int_resource(IDI_APPICON)).unwrap_or(h_icon) };
    let h_cursor = unsafe { LoadCursorW(None, IDC_ARROW).unwrap_or_default() };

    let wc = WNDCLASSEXW {
        cbSize: std::mem::size_of::<WNDCLASSEXW>() as u32,
        style: CS_HREDRAW | CS_VREDRAW,
        lpfnWndProc: Some(window_proc),
        cbClsExtra: 0,
        cbWndExtra: std::mem::size_of::<*const RefCell<AppState>>() as i32,
        hInstance: hinstance,
        hIcon: h_icon,
        hCursor: h_cursor,
        hbrBackground: HBRUSH::default(),
        lpszMenuName: PCWSTR::null(),
        lpszClassName: class_name,
        hIconSm: h_icon_small,
    };
    unsafe {
        RegisterClassExW(&wc);
    }

    let base_width = 1120;
    let base_height = 860;
    let dpi = unsafe { GetDpiForSystem() } as i32;
    let scaled_width = (base_width * dpi + 48) / 96;
    let scaled_height = (base_height * dpi + 48) / 96;
    let style = WS_OVERLAPPEDWINDOW;
    let mut window_rect = RECT {
        left: 0,
        top: 0,
        right: scaled_width,
        bottom: scaled_height,
    };
    unsafe {
        let _ = AdjustWindowRectEx(&mut window_rect, style, false, WINDOW_EX_STYLE::default());
    }
    let width_px = window_rect.right - window_rect.left;
    let height_px = window_rect.bottom - window_rect.top;

    let hwnd = unsafe {
        CreateWindowExW(
            WINDOW_EX_STYLE::default(),
            class_name,
            w!("mdhearts"),
            style,
            CW_USEDEFAULT,
            CW_USEDEFAULT,
            width_px,
            height_px,
            None,
            None,
            Some(hinstance),
            None,
        )
    }?;

    let haccel = init_menu_and_accels(hwnd);
    restore_window_placement(hwnd);
    unsafe {
        let _ = ShowWindow(hwnd, windows::Win32::UI::WindowsAndMessaging::SW_SHOW);
    }

    let mut msg = MSG::default();
    unsafe {
        while GetMessageW(&mut msg, None, 0, 0).into() {
            if TranslateAcceleratorW(hwnd, haccel, std::ptr::addr_of_mut!(msg)) != 0 {
                continue;
            }
            let _ = TranslateMessage(&msg);
            DispatchMessageW(&msg);
        }
        let _ = DestroyWindow(hwnd);
    }
    Ok(())
}

